embedding = tf.keras.layers.Embedding(input_dim=1000, output_dim=16)

def encontrar_resposta(pergunta_usuario):
    perguntas = list(perguntas_respostas.keys())
    respostas = list(perguntas_respostas.values())

    # Converter as perguntas para tensores
    perguntas_tokenizadas = np.array([sum(bytearray(p.encode("utf-8"))) for p in perguntas])
    usuario_tokenizado = np.array([sum(bytearray(pergunta_usuario.encode("utf-8")))])

    # Aplicar embedding
    perguntas_emb = embedding(perguntas_tokenizadas)
    usuario_emb = embedding(usuario_tokenizado)

    # Calcular similaridade usando produto escalar
    similaridades = np.dot(perguntas_emb.numpy(), usuario_emb.numpy().T)

    # Encontrar a pergunta mais similar
    indice_resposta = np.argmax(similaridades)
    return respostas[indice_resposta]

